    const pdfBlob = await html2pdf().set(options).from(content).output("blob");

    const formData = new FormData();
    formData.append("file", pdfBlob, `${id}_ECG.pdf`);

    const url = `${BASE_URL}org/upload?empId=${empId}&fileType=ECG&corpId=${corpId}&campCycleId=`;
    const result = await uploadFile(url, formData);
    if (result && result.data) {
      enqueueSnackbar("Successfully Uploaded PDF!", { variant: "success" });
    } else {
      enqueueSnackbar("An error Occurred!", { variant: "error" });
    }
